import 'bootstrap/dist/css/bootstrap.min.css';
import './SignIn.css';

function SignIn() {
    return (
        <div className="SignIn container-fluid">
            <div className="row">
                <h1>REGISTER AS</h1>
            </div>
            <div className="row justify-content-around tabs">
                <div className="col-4">
                    <div className="Image">
                        <img id="investor" src={investor} alt=""></img>
                    </div>
                    <a href="/SignUp" className="Button">INVESTOR</a>
                </div>
                <div className="col-4">
                    <div className="Image">
                        <img src={startup} alt=""></img>
                    </div>
                    <a href="/SignUp" className="Button">STARTUP</a>
                </div>
            </div>
        </div>
    );
  }

  export default SignIn;
